import React, { Component } from "react";
import * as ReactBoostrap from 'react-bootstrap';
import { Button } from "./Buttons";
import './PantallaPrincipal.css';
import './App.css';

export default class PantallaPrincipal extends Component {

    constructor() {
        super();
        this.state = {
        }
    }

    render() {
        return (
            <div className="PantallaPrincipal">
                <video src='/videos/video-2.mp4'
                    autoPlay loop muted></video>
                <h1>CAR CLEAN</h1>
                <p>"Servicio Integral Vehicular"</p>
                <div className='btnsPantallaPrincipal'>
                    <Button className='btns' buttonStyle='btn--outline'
                        buttonSize='btn--large'
                    >
                        ACERCA DE NOSTROS
                    </Button>
                    <Button className='btns'
                        buttonStyle='btn--primary'
                        buttonSize='btn--large'
                    >
                        AGENDA TUS SERVICIOS
                    </Button>
                </div>                
            </div>            
        );

    }
}
